import React from "react";

const tomcat_img = () => (
  <div>
    <i class="devicon-tomcat-line" />
  </div>
);

const tomcat = {
  title: "Tomcat",
  icon: tomcat_img,
  svg_icon: null,
  value: "40"
};

export default tomcat;
